import React, { Component } from 'react';
import './index.css';


class Schedule extends Component {


  render(){

    return (
      <div className='schedule-slab'>

        <img className='elvis-sand' src='https://images2.minutemediacdn.com/image/upload/c_crop,h_1944,w_3456,x_0,y_360/f_auto,q_auto,w_1100/v1554910869/shape/mentalfloss/539787-istock-471070741.jpg' />
        <div className='elvis-title'>Peanut Butter Banana Bacon Parfait</div>

      </div>
    );
  }
}

export default Schedule;
